(8, 1, '2021-01-23 10:27:11', '2021-01-23 10:27:11', '<!-- wp:themify-builder/canvas /--><!--themify_builder_static--><h1>We\'re Open</h1>\n<p>Order direct on our website and save 15 %. Pickup or Delivery Available.</p>\n<p>[restaurant-menu-and-ordering ruid=\"9ae3357f-16b3-4b19-b920-280134a93c70\"]</p>\n<p>[restaurant-reservations ruid=\"9ae3357f-16b3-4b19-b920-280134a93c70\"]</p>\n<h2>Our Story</h2>\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nulla nec interdum orci. Aenean id sapien sollicitudin, tincidunt nulla eget, vulputate diam. Proin egestas augue ante, tempus accumsan velit lacinia aliquet. Nullam posuere, neque interdum facilisis pellentesque, tellus lectus bibendum ipsum, et cursus nibh augue eu ipsum. Maecenas sit amet maximus velit, vitae commodo leo. </p>\n<img loading=\"lazy\" width=\"800\" height=\"533\" src=\"http://localhost/MiGato/wp-content/uploads/2021/01/some-image-8-800-x-533.jpg\" title=\"some image 8 (800 x 533)\" alt=\"some image 8 (800 x 533)\" srcset=\"http://localhost/MiGato/wp-content/uploads/2021/01/some-image-8-800-x-533.jpg 800w, http://localhost/MiGato/wp-content/uploads/2021/01/some-image-8-800-x-533-300x200.jpg 300w, http://localhost/MiGato/wp-content/uploads/2021/01/some-image-8-800-x-533-768x512.jpg 768w\" sizes=\"(max-width: 800px) 100vw, 800px\" />\n<h2>Menu</h2>\n<img loading=\"lazy\" src=\"http://localhost/MiGato/wp-content/uploads/2021/01/order-food-1-100-x-100-100x100.jpg\" width=\"100\" height=\"100\" title=\"order food 1 (100 x 100)\" alt=\"Mie Ayam\"> \n <h4>Mie Ayam</h4> Mie Ayam dengan ayam hidup \n Rp 18.000 <br/>\n<img loading=\"lazy\" src=\"http://localhost/MiGato/wp-content/uploads/2021/01/order-food-2-100-x-100-100x100.jpg\" width=\"100\" height=\"100\" title=\"order food 2 (100 x 100)\" alt=\"Kwetiau\"> \n <h4>Kwetiau</h4> Original Kwetiau \n Rp 21.000 <br/>\n<img loading=\"lazy\" src=\"http://localhost/MiGato/wp-content/uploads/2021/01/order-food-5-100-x-100-100x100.jpg\" width=\"100\" height=\"100\" title=\"order food 5 (100 x 100)\" alt=\"Nasi Goreng Pete\"> \n <h4>Nasi Goreng Pete</h4> Nasi Goreng dengan tambahan pete \n Rp 22.000 <br/>\n<img loading=\"lazy\" src=\"http://localhost/MiGato/wp-content/uploads/2021/01/order-food-4-100-x-100-100x100.jpg\" width=\"100\" height=\"100\" title=\"order food 4 (100 x 100)\" alt=\"Nasi Goreng Gila\"> \n <h4>Nasi Goreng Gila</h4> Rasakan pedasnya \n Rp 20.000 <br/>\n<img loading=\"lazy\" src=\"http://localhost/MiGato/wp-content/uploads/2021/01/order-food-8-100-x-100-100x100.jpg\" width=\"100\" height=\"100\" title=\"order food 8 (100 x 100)\" alt=\"Kebab Original\"> \n <h4>Kebab Original</h4> Kebab isi daging \n Rp 10.000 <br/>\n<img loading=\"lazy\" src=\"http://localhost/MiGato/wp-content/uploads/2021/01/order-food-9-100-x-100-100x100.jpg\" width=\"100\" height=\"100\" title=\"order food 9 (100 x 100)\" alt=\"Kebab jumbo\"> \n <h4>Kebab jumbo</h4> Kebab isi daging + sayur + telur + keju \n Rp 18.000 <br/>\n<a href=\"http://localhost/MiGato/wp-content/uploads/2021/01/SOAL-UAS-Reg1_10.15_.pdf\" target=\"_blank\" rel=\"noopener\" download> Download Menu </a>\n<h2>Gallery</h2>\n[gallery ids=\"38,39,40\"]\n<h3>Opening Hours</h3>\n<p>Open everyday</p> <p>Monday to Friday - 12.00 to 22.00 WIB</p> <p>Saturday to Sunday - 07.00 to 22.00 WIB</p> <p> </p>\n<a href=\"tel: 085157455371\"> <i><svg><use href=\"#tf-ti-mobile\"></use></svg></i> 085157455371 </a>\n<a href=\"mailto: imam.hilmi253@gmail.com\"> <i><svg><use href=\"#tf-ti-email\"></use></svg></i> imam.hilmi253@gmail.com </a>\n<h3>Find Us Here</h3>\n<p>Jl. HOS Cokroaminoto No.7H, RT.005/RW.002, Kreo, Kec. Ciledug, Kota Tangerang, Banten 15156</p>\n<p><iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d495.7770636689208!2d106.73669248866517!3d-6.235166516188136!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x2e69f0bb588d9d6f%3A0xe4312355d6a70d34!2sKOPI%20HARUM%20MANIS!5e0!3m2!1sid!2sid!4v1611465134244!5m2!1sid!2sid\" width=\"100%\" height=\"450\" frameborder=\"0\" style=\"border:0;\" allowfullscreen=\"\" aria-hidden=\"false\" tabindex=\"0\"></iframe></p>\n<h3>Contact Us</h3>\n<form action=\"http://localhost/MiGato/wp-admin/admin-ajax.php\" class=\"builder-contact\" id=\"tb_ogw9496-form\" method=\"post\" data-post-id=\"0\" data-element-id=\"ogw9496\" > <label for=\"tb_ogw9496-contact-name\">Name *</label> <input type=\"text\" name=\"contact-name\" placeholder=\"\" id=\"tb_ogw9496-contact-name\" value=\"\" required/> <label for=\"tb_ogw9496-contact-email\">Email *</label> <input type=\"text\" name=\"contact-email\" placeholder=\"\" id=\"tb_ogw9496-contact-email\" value=\"\" required/> <label for=\"field_extra_0\"> Telephone Number <input type=\"hidden\" name=\"field_extra_name_0\" value=\"Telephone Number\"/> * </label> <input type=\"tel\" name=\"field_extra_0\" id=\"field_extra_0\" placeholder=\"\" required /> <label for=\"field_extra_1\"> Upload File <input type=\"hidden\" name=\"field_extra_name_1\" value=\"Upload File\"/> </label> <input type=\"file\" name=\"field_extra_1\" id=\"field_extra_1\" /> <label for=\"tb_ogw9496-contact-subject\">Subject *</label> <input type=\"text\" name=\"contact-subject\" placeholder=\"\" id=\"tb_ogw9496-contact-subject\" value=\"\" required/> <label for=\"tb_ogw9496-contact-message\">Message *</label> <textarea name=\"contact-message\" placeholder=\"\" id=\"tb_ogw9496-contact-message\" rows=\"8\" cols=\"45\" required></textarea> <button type=\"submit\"> Send</button> </form><!--/themify_builder_static-->', 'Beranda', '', 'publish', 'closed', 'closed', '', 'beranda', '', '', '2021-01-24 05:33:21', '2021-01-24 05:33:21', '', 0, 'http://localhost/MiGato/?page_id=8', 0, 'page', '', 0),
